--
-- А) какую сумму в среднем в месяц тратит: пользователи в возрастном диапазоне от 18 до 25 лет включительно
--


SELECT ROUND(AVG(Items.price)) AS Средние_траты_по_месяцам, EXTRACT(MONTH FROM Purchases.date) AS Месяц, EXTRACT(YEAR FROM Purchases.date) AS Год
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 18 AND 25
GROUP BY Год, EXTRACT(MONTH FROM Purchases.date)
ORDER BY Год, EXTRACT(MONTH FROM Purchases.date)
;
SELECT ROUND(AVG(Q.AVG_PER_MONTH)) AS ср_сумма_месяц_от_18_до_25
FROM
(
SELECT ROUND(AVG(Items.price)) AS AVG_PER_MONTH
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 18 AND 25
GROUP BY EXTRACT(YEAR FROM Purchases.date), EXTRACT(MONTH FROM Purchases.date)
) AS Q
;

--
-- А) какую сумму в среднем в месяц тратит: пользователи в возрастном диапазоне от 26 до 35 лет включительно
--

SELECT ROUND(AVG(Items.price)) AS Средние_траты_по_месяцам, EXTRACT(MONTH FROM Purchases.date) AS Месяц, EXTRACT(YEAR FROM Purchases.date) AS Год
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 26 AND 35
GROUP BY Год, EXTRACT(MONTH FROM Purchases.date)
ORDER BY Год, EXTRACT(MONTH FROM Purchases.date)
;
SELECT ROUND(AVG(Q.AVG_PER_MONTH)) AS ср_сумма_месяц_от_26_до_35
FROM
(
SELECT ROUND(AVG(Items.price)) AS AVG_PER_MONTH
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 26 AND 35
GROUP BY EXTRACT(YEAR FROM Purchases.date), EXTRACT(MONTH FROM Purchases.date)
) AS Q
;

--
-- Б) в каком месяце года выручка от пользователей в возрастном диапазоне 35+ самая большая
--

SELECT sum(price) as Выручка, to_char(date, 'Month') as Месяц
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
Where users.age >= 35
group by Месяц
ORDER BY Выручка DESC
LIMIT 1
;

--
-- В) какой товар обеспечивает дает наибольший вклад в выручку за последний год
--

SELECT SUM(price) as выручка, itemid
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE EXTRACT(YEAR FROM Purchases.date)= EXTRACT(YEAR FROM CURRENT_DATE) - 1
Group by  itemid
Order by выручка DESC
LIMIT 1
;

--
-- Г) топ-3 товаров по выручке и их доля в общей выручке за любой год
--

SELECT  Items.itemId,
  SUM(Items.price) AS Общ_Выручка_товар,
  SUM(Items.price) / (
      SELECT SUM(i.price)
      FROM Items AS i INNER JOIN Purchases AS p USING(itemId)
      WHERE EXTRACT(YEAR FROM p.date) = YYYY
  ) AS доля_товара_выручке
FROM Purchases INNER JOIN Items USING(itemId)
WHERE
  EXTRACT(YEAR FROM Purchases.date) = YYYY
GROUP BY  Items.itemId
ORDER BY Общ_Выручка_товар DESC
LIMIT 3

-- необходимо подставить вместо YYYY номер года, по которому требуется запрос в нашем случае (2020|2021|2022)